import React from 'react';

const Header = () => {
    return (
        <header>
            <div className="d-flex p-4 justify-content-around">
                <div className="title fw-bold text-black-50 fs-3">Tests</div>
                <div className="d-flex">
                    <div className="text-black-50">Add new test</div>
                    <div className="text-black-50">Pass test</div>
                </div>

            </div>
        </header>
    );
};

export default Header;
